INSERT INTO `user_group_permission` VALUES (1,'ການບໍລິຫານຜູ້ໃຊ້ງານ','ເພີ່ມຜູ້ໃຊ້ງານ ( User Add )','ອະນຸຍາດໃນການເພີ່ມຜູ້ໃຊ້ງານ'),(2,'ການບໍລິຫານຜູ້ໃຊ້ງານ','ລົບລ້າງ ( User Remove )','ອະນຸຍາດໃຫ້ລົບລ້າງຜູ້ໃຊ້ງານ'),(3,'ການບໍລິຫານຜູ້ໃຊ້ງານ','ສະແດງລາຍການ ( User List )','ອະນຸຍາດໃຫ້ສະແດງລາຍການຜູ້ໃຊ້ງານ'),(4,'ການບໍລິຫານຜູ້ໃຊ້ງານ','ແກ້ໄຂລະຫັດຜ່ານ ( Change User Password )','ອະນຸຍາດໃຫ້ແກ້ໄຂລະຫັດຜ່ານຂອງຜູ້ໃຊ້ງານ'),(5,'ການບໍລິຫານລາຍການລູກຄ້າ','ສະແດງລາຍການ ( Customer List )','ອະນຸຍາດໃຫ້ສະແດງລາຍການຂໍ້ມູນລູກຄ້າ'),(6,'ການບໍລິຫານລາຍການລູກຄ້າ','ເພີ່ມລາຍການ ( Customer Add )','ອະນຸຍາດໃຫ້ເພິ້ມລາຍການລູກຄ້າ'),(7,'ການບໍລິຫານລາຍການລູກຄ້າ','ແກ້ໄຂ ( Customer Edit )','ອະນຸຍາດໃຫ້ແກ້ໄຂລາຍການລູກຄ້າ'),(8,'ການບໍລິຫານລາຍການລູກຄ້າ','ລົບລ້າງ ( Customer Remove )','ອະນຸຍາດໃຫ້ລົບລ້າງລາຍການລູກຄ້າ'),(10,'ການບໍລິຫານຜູ້ໃຊ້ງານ','ກຳໜົດສິດກຸ່ມຜູ້ໃຊ້ງານ ( Set Group Permission )','ອະນຸຍາດໃຫ້ກຳໜົດສິດກຸ່ມຜູ້ໃຊ້ງານ'),(11,'ຕັ້ງຄ່າ','ແກ້ໄຂອັດຕາແລກປ່ຽນ ( Update Exchange Rate )','ອະນຸຍາດໃຫ້ແກ້ໄຂອັດຕາແລກປ່ຽນ'),(12,'ຕັ້ງຄ່າ','ຕັ້ງຄ່າທົ່ວໄປ ( General Setting )','ອະນຸຍາດໃຫ້ແກ້ໄຂຄ່າຂໍ້ມູນພື້ນຖານທົ່ວໄປ'),(13,'ລາຍງານ','ສະແດງ ລາຍລະອຽດການສົ່ງ','ອະນຸຍາດໃຫ້ ສະແດງ ລາຍການລາຍລະອຽດການສົ່ງ'),(15,'ລາຍງານ','ສະແດງ ລາຍການຜະລິດແຍກຕາມລູກຄ້າ (Material Report by Cust.)','ອະນຸຍາດໃຫ້ ສະແດງ ລາຍການຜະລິດແຍກຕາມລູກຄ້າ (Material Report by Cust.)'),(17,'ລາຍງານ','ສະແດງ ລາຍລະອຽດການຂາຍ (Transaction Report)','ອະນຸຍາດໃຫ້ ສະແດງ  ລາຍລະອຽດການຂາຍ (Transaction Report)'),(19,'ລາຍການ ສິນຄ້າ','ເພີ່ມລາຍການ','ອະນຸຍາດໃຫ້ເພີ່ມລາຍການສິນຄ້າ'),(20,'ລາຍການ ສິນຄ້າ','ແກ້ໄຂລາຍການ ສິນຄ້າ','ອະນຸຍາດໃຫ້ແກ້ໄຂລາຍການສິນຄ້າ'),(21,'ລາຍການ ສິນຄ້າ','ລົບລ້າງລາຍການ ສິນຄ້າ','ອະນຸຍາດໃຫ້ລົບລ້າງລາຍການສິນຄ້າ'),(22,'ລາຍການ ການບໍລິການ','ເພີ່ມລາຍການ','ອະນຸຍາດໃຫ້ເພີ່ມລາຍການ ການບໍລິການ'),(23,'ລາຍການ ການບໍລິການ','ແກ້ໄຂ','ອະນຸຍາດໃຫ້ແກ້ໄຂ ລາຍການ ການບໍລິການ'),(24,'ລາຍການ ການບໍລິການ','ລົບລ້າງ','ອະນຸຍາດໃຫ້ລົບລ້າງ ລາຍການ ການບໍລິການ'),(25,'ລາຍການຂາຍ (Transaction)','ສ້າງ ໃບສະເຫນີລາຄາ','ອະນຸຍາດຍາດໃຫ້ ສ້າງ ໃບສະເຫນີລາຄາ'),(26,'ລາຍການຂາຍ (Transaction)','ສ້າງ ລາຍການຂາຍ','ອະນຸຍາດໃຫ້ ສ້າງ ລາຍການຂາຍ'),(27,'ລາຍການຂາຍ (Transaction)','ໂອນເປັນ \"ລາຍການຂາຍ\"','ອະນຸຍາດໃຫ້ ໂອນເປັນ \"ໃບສະເຫນີລາຄາ\" ເປັນ \"ລາຍການຂາຍ\"'),(28,'ລາຍການຂາຍ (Transaction)','ສ້າງ \"ໃບຮຽກເກັບເງິນ\"','ອະນຸຍາດໃຫ້ ສ້າງ \"ໃບຮຽກເກັບເງິນ\"'),(29,'ລາຍການຂາຍ (Transaction)','ຍົກເລີກ ລາຍການ','ອະນຸຍາດໃຫ້ ຍົກເລີກ \"ລາຍການຂາຍ\" ຫລືື \"ໃບສະເຫນີລາຄາ\"'),(30,'ລາຍການຂາຍ (Transaction)','ພິມ \"ໃບສະເຫນີລາຄາ\"','ອະນຸຍາດໃຫ້ ພິມ \"ໃບສະເຫນີລາຄາ\"'),(31,'ລາຍການຂາຍ (Transaction)','ເພີ່ມ ລາຍການ ສິນຄ້າ / ການບໍລິການ','ອະນຸຍາດ ໃຫ້ເພີ່ມ ສິນຄ້າ / ການບໍລິການ ເຂົ້າໃນ \"ລາຍການຂາຍ\" ຫລືື \"ໃບສະເຫນີລາຄາ\"'),(33,'ລາຍການຂາຍ (Transaction)','ແກ້ໄຂ ລາຍການ ສິນຄ້າ / ການບໍລິການ','ອະນຸຍາດໃຫ້ ລາຍການ ສິນຄ້າ / ການບໍລິການ'),(34,'ລາຍການຂາຍ (Transaction)','ລົບລ້າງ ລາຍການ ສິນຄ້າ / ການບໍລິການ','ອະນຸຍາດໃຫ້ ລົບລ້າງ ລາຍການ ສິນຄ້າ / ການບໍລິການ'),(38,'ລາຍການ ສິນຄ້າ','ສະແດງ ລາຍການ ສິນຄ້າ','ອະນຸຍາດໃຫ້ ສະແດງລາຍການ ສິນຄ້າ'),(39,'ລາຍການ ການບໍລິການ','ສະແດງ ລາຍການ ການບໍລິການ','ອະນຸຍາດໃຫ້ ສະແດງລາຍການ ລາຍການສິນຄ້າ'),(40,'ລາຍການຂາຍ (Transaction)','ສະແດງ ລາຍການຂາຍ (Transaction)','ອະນຸຍາດໃຫ້ ສະແດງ ລາຍການຂາຍ (Transaction)'),(41,'ລາຍການຂາຍ (Transaction)','ຮັບເງິນ ຈາກ \"ໃບຮຽກເກັບເງິນ\"','ອະນຸຍາດໃ້ຫ ຮັບເງິນ ຈາກ \"ໃບຮຽກເກັບເງິນ\"'),(42,'ລາຍການຂາຍ (Transaction)','ຍົກເລິກ \"ໃບຮຽກເກັບເງິນ\"','ອະນຸຍາດໃ້ຫ ຍົກເລິກ \"ໃບຮຽກເກັບເງິນ\"'),(43,'ລາຍການຂາຍ (Transaction)','ພິມ \"ໃບຮຽກເກັບເງິນ\"','ອະນຸຍາດໃຫ້ ພິມ \"ໃບຮຽກເກັບເງິນ\"');
